import React from "react";
import Sidebar from "../components/Sidebar";

function Layout({ routes, isAuthenticated }) {
  return (
    <>
      <div className="app">
        <Sidebar />
        <div className="main">main</div>
      </div>
    </>
  );
}

export default Layout;
